md"Im letzten Übungsblatt und in der Vorlesung haben wir gesehen, dass sich Zeitsignale aus einer Reihe von Sinus-Schwingungen mit unterschiedlicher Frequenz, Amplitude und Phase zusammensetzen lassen. Dies trifft natürlich nicht nur auf die relativ einfachen Signale der letzten Woche zu, sondern auch auf komplexere Signale, wie zum Beipiel die Signale, die bei einem EKG aufgenommen werden. Das mathematische Werkzeug, das die einzelnen Bestandteile eines Signals berechnen kann ist die Fourier-Transformation. In diesem Übungsblatt soll es darum gehen, die Anwendung der diskreten Fourier-Transformation zu üben, damit Sie dann in den nächsten Wochen das Gelernte auf die Analyse eines EKG-Signals anwenden können."

